import Vue from 'vue'
import App from './App.vue'
import './plugins/element.js'
import VueRouter from 'vue-router'
import Home from "./components/Home.vue"

Vue.config.productionTip = false
Vue.use(VueRouter)

new Vue({
  router,
  render: h => h(App),
}).$mount('#app')


const router = new VueRouter({
    routes: [
        { path: '/', redirect: '/home' },
        { path: '/', component: Home }
    ]
})
